import './App.css';
import './component/style.css';
import Header from './component/header';
import About from './component/about';
import Experience from './component/experience';
import Projects from './component/projects';
function App() {
  return (
    <div className="App">
      <Header></Header>
      <About></About>
      <Experience></Experience>
      <Projects></Projects>
    </div>
  );
}

export default App;
